webpackJsonp([68911785815438],{2056:function(e,t){e.exports={pathContext:{docHtml:'<h1>assign-deep <a href="https://www.npmjs.com/package/assign-deep"><img src="https://img.shields.io/npm/v/assign-deep.svg?style=flat" alt="NPM version"></a> <a href="https://npmjs.org/package/assign-deep"><img src="https://img.shields.io/npm/dm/assign-deep.svg?style=flat" alt="NPM monthly downloads"></a> <a href="https://npmjs.org/package/assign-deep"><img src="https://img.shields.io/npm/dt/assign-deep.svg?style=flat" alt="NPM total downloads"></a> <a href="https://travis-ci.org/jonschlinkert/assign-deep"><img src="https://img.shields.io/travis/jonschlinkert/assign-deep.svg?style=flat&#x26;label=Travis" alt="Linux Build Status"></a></h1>\n<blockquote>\n<p>Deeply assign the enumerable properties and/or es6 Symbol properies of source objects to the target (first) object.</p>\n</blockquote>\n<h2>Install</h2>\n<p>Install with <a href="https://www.npmjs.com/">npm</a>:</p>\n<pre><code class="language-sh">$ npm install --save assign-deep\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">var assign = require(\'assign-deep\');\n\nvar one = {b: {c: {d: \'e\'}}};\nvar two = {b: {c: {f: \'g\', j: \'i\'}}};\nvar three = {foo: \'bar\'};\n\nconsole.log(assign(one, two, three));\n//=> {b: {c: {d: \'e\', f: \'g\', j: \'i\'}}, foo: \'bar\'}\n</code></pre>\n<h2>About</h2>\n<h3>Related projects</h3>\n<p>You might also be interested in these projects:</p>\n<ul>\n<li><a href="https://www.npmjs.com/package/assign-symbols">assign-symbols</a>: Assign the enumerable es6 Symbol properties from an object (or objects) to the first object… <a href="https://github.com/jonschlinkert/assign-symbols">more</a> | <a href="https://github.com/jonschlinkert/assign-symbols" title="Assign the enumerable es6 Symbol properties from an object (or objects) to the first object passed on the arguments. Can be used as a supplement to other extend, assign or merge methods as a polyfill for the Symbols part of the es6 Object.assign method.">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/extend-shallow">extend-shallow</a>: Extend an object with the properties of additional objects. node.js/javascript util. | <a href="https://github.com/jonschlinkert/extend-shallow" title="Extend an object with the properties of additional objects. node.js/javascript util.">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/merge-deep">merge-deep</a>: Recursively merge values in a javascript object. | <a href="https://github.com/jonschlinkert/merge-deep" title="Recursively merge values in a javascript object.">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/mixin-deep">mixin-deep</a>: Deeply mix the properties of objects into the first object. Like merge-deep, but doesn\'t clone. | <a href="https://github.com/jonschlinkert/mixin-deep" title="Deeply mix the properties of objects into the first object. Like merge-deep, but doesn&#x27;t clone.">homepage</a></li>\n</ul>\n<h3>Contributing</h3>\n<p>Pull requests and stars are always welcome. For bugs and feature requests, <a href="../../issues/new">please create an issue</a>.</p>\n<h3>Contributors</h3>\n<table>\n<thead>\n<tr>\n<th><strong>Commits</strong></th>\n<th><strong>Contributor</strong></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>23</td>\n<td><a href="https://github.com/jonschlinkert">jonschlinkert</a></td>\n</tr>\n<tr>\n<td>11</td>\n<td><a href="https://github.com/doowb">doowb</a></td>\n</tr>\n</tbody>\n</table>\n<h3>Building docs</h3>\n<p><em>(This project\'s readme.md is generated by <a href="https://github.com/verbose/verb-generate-readme">verb</a>, please don\'t edit the readme directly. Any changes to the readme must be made in the <a href=".verb.html">.verb.md</a> readme template.)</em></p>\n<p>To generate the readme, run the following command:</p>\n<pre><code class="language-sh">$ npm install -g verbose/verb#dev verb-generate-readme &#x26;&#x26; verb\n</code></pre>\n<h3>Running tests</h3>\n<p>Running and reviewing unit tests is a great way to get familiarized with a library and its API. You can install dependencies and run tests with the following command:</p>\n<pre><code class="language-sh">$ npm install &#x26;&#x26; npm test\n</code></pre>\n<h3>Author</h3>\n<p><strong>Jon Schlinkert</strong></p>\n<ul>\n<li><a href="https://github.com/jonschlinkert">github/jonschlinkert</a></li>\n<li><a href="https://twitter.com/jonschlinkert">twitter/jonschlinkert</a></li>\n</ul>\n<h3>License</h3>\n<p>Copyright © 2017, <a href="https://github.com/jonschlinkert">Jon Schlinkert</a>.\nReleased under the <a href="LICENSE">MIT License</a>.</p>\n<hr>\n<p><em>This file was generated by <a href="https://github.com/verbose/verb-generate-readme">verb-generate-readme</a>, v0.6.0, on August 03, 2017.</em></p>',docPath:"argo-ci/node_modules/assign-deep/readme",proj:"argo-ci"}}}});
